pub enum EitherBody<L, R = BoxBody> {
    Left {
        body: L,
    },
    Right {
        body: R,
    },
}

pub enum Payload<S = BoxedPayloadStream> {
    None,
    H1 {
        payload: crate::h1::Payload,
    },
    H2 {
        payload: crate::h2::Payload,
    },
    Stream {
        payload: S,
    },
}

pub enum RequestHeadType {
    Owned(RequestHead),
    Rc(Rc<RequestHead>, Option<HeaderMap>),
}

pub enum Item {
    FirstText(Bytes),
    FirstBinary(Bytes),
    Continue(Bytes),
    Last(Bytes),
}

pub enum DispatcherError<E, U, I> where U: Encoder<I> + Decoder {
    Service(E),
    Encoder(<U as Encoder<I>>::Error),
    Decoder(<U as Decoder>::Error),
}
